import '../../SCSS/login.scss'
import '../../Images/nge.png'

class login extends Component {
    render() {
        return (
            <div id="loginMainPanel">
                <div id="leftPanel">
                    <img src="../../../src/Images/nge.png" id="ngeLogo" />

                </div>

                <div id="middlePanel">

                </div>


            </div>
        );
    }
}

export default login;
